import React, { Component } from "react";
import { CSSTransition } from "react-transition-group";

import "./App.css";
import "./Homepage.css";
import Title from "./Title";

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      homeAppear: true
    };
  }

  render() {
    let anim = this.state.homeAppear;
    if(this.state.homeAppear) {
      anim = this.state.homeAppear
    } else {
      anim = !this.state.homeAppear
    }
    return (
      <div className="Homepage">
        <div className="titles">
          <h1> selected works </h1>
          <Title text="branding." />
          <Title text="collages." />
          <Title text="keynote designs." />
          <Title text="posters." />
          <Title text="user interface designs." />
        </div>

        <CSSTransition
          in={anim}
          appear={true}
          timeout={{
            appear: 500,
            exit: 500}}

          classNames="fade"
        >
          <div className="imageWrapper">
            <img src="https://raw.githubusercontent.com/tirzatirza14/portfolio/master/spread.gif" />
          </div>
        </CSSTransition>
      </div>
    );
  }
}

export default Homepage;
